한국 드라마 촬영을 자주 할정도로 멋지고 넓은 옥상이 있어서 명동에서 가장 멋진 야경을 자랑합니다. 아트몬 옥상에서 남산타워와 명동야경을 바라보며 한국 치킨과 맥주를 즐겨보세요. 바베큐 그릴까지 준비되어 있어 아름다운 야경과 함께 바베큐 파티도 가능합니다. ( 4만원)

쇼핑의 천국인 명동 메인 쇼핑 거리와 도보 10분거리에 있으며 남대문은 차로 5분, 동대문은 차로 10분거리, 남산 케이블카는 도보 5분거리에 있으며 남산 한옥 마을은 도보 17분거리에 있습니다. 인천공항까지는 차로 1시간 10분거리에 있습니다. 도보로 1분거리에 유명한 레스토랑 거리가 있어서 남산의 유명한 음식을 맛볼수 있습니다.

