에퀴녹스는 주야 평분시, 즉 낮과 밤의 길이가 같아지는 춘분과 추분을 뜻합니다.
밤과 낮의 길이가 같아지는 춘분/추분 때와 같이 우리의 삶 속에서도 일, 휴식, 가족, 성공, 건강, 행복 등의 밸런스를 맞출 수 있기를 바라는 마음을 담아 지어진 이름입니다.
또한, 저희 Equinoxe의 약칭은 EQ (Emotional Quotient:감성지수)입니다. 우리 아이들이 에퀴녹스에 와서 자연의 소리와 냄새와 함께 층간 소음 걱정 없이 크게 웃고 뛰어 노는 동안 만큼은 성적이나 등수 걱정이 아닌 저마다 다른 감성을 느끼는 시간을 보낼 수 있기를 바랍니다.  
에퀴녹스는 깔끔하게 정돈된 여유 있고 절제된 공간 안에 고객을 위한 세심한 배려를 담아 여러분을 맞이하겠습니다. 
저희 에퀴녹스에 머무는 시간만큼은 복잡하게 뒤섞여 사는 일상에서 벗어나 나만을, 또는, 우리 가족, 우리 친구들만을 위한 독립적이고 한가로운 공간과 시간 속에서 킨포그 (kinfolk) 스러움을 즐기며 삶의 밸런스를 찾아보고 느껴보시기 바랍니다.
