제 휴즈에 잘 어울립니다. 며칠 동안 당신과 함께 지낼 수 있어서 영광입니다.
이 후는 60년이 넘었습니다. 할아버지 아버지가 이 집을 지었습니다.
저희 어머니는 이 집에서 살았고, 저도 아이를 낳을 때 이곳에서 살았습니다.

kang neung은 한국 S의 작은 도시이지만, 한국에는 관광객이 다양하게 유명합니다.
왜냐하면 이곳의 모든 바다, 산, 강이 있기 때문입니다.
또한 겨울 스포츠를 쉽게 즐길 수 있습니다.

경포해수욕장은 이곳에서 그리 멀지 않습니다. 차로 약 12분이 소요됩니다. 푸른 바다와 모래사장을 산책할 수 있습니다.

저희 집은 도시 (고향) 와 중앙 재래시장과 매우 가깝습니다.
