아프리카에서 여행사 & 게스트 하우스 운영 경험을 바탕으로 광주 송정역에 조아 게스트 하우스를 오픈하게 되었습니다.  1층 & 2층 아프리카 소품으로  깨끗하고 아늑하게 준비 하였으니 편히 쉬었다 가세요. 광주 송정역 조아 게스트 하우스에 오시면 제가 아프리카 10개국을 여행하며 수집한 독특한 아프리카 토속 공예품이 전시되어 있습니다. 이색적이고 독특한  아프리카를 경험 할 수 있는 특별한 여행이 될 것입니다. 

