# 숙소주변
  - 황리단길, 야시장, 대릉원, 황남빵, 하나로마트, 편의점
    스타벅스, 맥도날드,시내버스 고속버스 터미널, 스크린골프
    등 주변편의 시설이 도보 5분~10분 거리
  - 버스정류장 도보 2분거리에 있어 보분, 버드파크, 블루원,   
   경주월드(캘리포니아 비치), 경주 엑스포, 불국사 등 경주 대표 관광지 이동이 편리함.(환승없이가능)

 # 입&퇴실 사항
   - 2인기준 (추가인원불가-적발시 퇴실)
   - 체크인  오후 3시 
     체크아웃 오전11시
   - 셀프 체크인 도어락(비밀번호 예약당일 알려드림)

# 주의사항
   - 실내 삼겹살, 생선 냄새가 심한 음식은 조리가 안되며 
     간단한 요리는 가능
   - 실내흡연은 절대 금연입니다.(꼭 지켜주세요)
   - 밤 10시이후 고성방가 자제부탁드립니다.
   - 애완동물 동반입 안됩니다.
   - 음식물, 모든 쓰레기는 객실내 분리수거 해주시고 
     사용하신 주방기구는 세척해 두심 됩니다.
     언제든 필요하시거나 불편사항 문의주세요.

     바로 해결해 드립니다.

