        (1544, '9362d69f-f61d-4f0f-9137-9f26710dc71d', '경순', 'https://a0.muscache.com/im/pictures/user/9c41616e-4d00-4497-b73c-6bec44174a81.jpg', 1, 1, '숙소 소개: 우리 집은 사람이 아닙니다. 

제 남편과 저는 불충분한 조화를 이루는 로맨틱한 커플입니다. 우리는 35년 이상 결혼했습니다.
또한, 저희는 사교적이고 영어를 구사할 수 있습니다.  사람들은 우리를 ‘재미있는 커플’ 이라고 부릅니다.

저희는 여러분과 훌륭한 유머 감각을 공유할 준비가 되어 있습니다!
우리는 외향적이고 열린 마음을 갖고 있기 때문에 해외 여행을 즐기고 다른 나라에서 온 방문객을 맞이하는 것을 즐깁니다.
그래서 두 자녀가 결혼했고 저와 제 남편에게 집이 너무 커서 홈스테이에 침실 3개를 제공하기 시작했습니다.

한국에 잠시 머무를 계획이라면, 한국 홈스테이가 기억에 남고 잊을 수 없는 경험이 될 수 있도록 하는 방법을 알아보겠습니다.


저희 숙소의 가장 좋은 특징 네 가지. 

1. 한국어 또는 영어로 일상으로 편하게 말씀해 주세요.

한국어를 사용해보고 개선할 수 있습니다. 물론 무료입니다.
이전 방문객과 계속 연락하고 있습니다. 한국어 실력을 향상시키기 위해 한국어로 대화하는 것이 도움이 되었다고 합니다. 


2. 최고의 위치에서 안전하게 지내세요

경비원이 제 아파트를 24시간 관리하며, 저희 지역 지역 지역은 안전한 환경으로 유명합니다. 
무엇보다 시내 지역에 위치하고 있으며 지하철, 버스, 택시, 공항 셔틀 등 대중교통으로 쉽게 이동할 수 있습니다. 잠실루 지하철역 (2호선) 까지 5분 거리에 있습니다.

큰 단지이기 때문에 저희 집을 사랑하고 편안하게 지내실 수 있습니다.
아파트 단지에서 운동하는 것도 좋은 선택입니다.


3. 원하는 모든 것을 이용할 수 있습니다.

보통 올림픽 공원과 한강에서 공연이나 콘서트가 열립니다. 걸어서 즐길 수 있습니다. 서울의 상징인 한강의 야경도 감상할 수 있습니다. 한류 열풍 팬들이 와서 공연을 즐길 수 있습니다.

또는 한국에서 가장 큰 놀이공원 중 하나인 롯데월드 방문 후 롯데몰에서 쇼핑을 즐겨보세요. 극장에서 영화나 뮤지컬을 감상하고 아쿠아리움에 오세요. 아파트 근처의 롯데 지역에서 모두 이용할 수 있습니다. 걸어서 10분도 걸리지 않습니다.


4. 홈스테이에서의 긴 경험

홈스테이 하우스는 5년 이상 운영되었습니다. 경험이 많기 때문에 방문 중 즐거운 시간을 보내시고 겪을 수 있는 문제를 해결하는 데 도움을 드릴 수 있습니다.

무료 빠른 Wi-Fi를 제공합니다.
인터넷 없이는 살 수 없습니다. 인터넷을 사용할 수 있습니다.

또한, 요청에 따라 맛있는 식사를 제공합니다. 저는 좋은 요리사입니다. 맛있는 한식을 드실 수 있습니다. 저희 덕분에 몸무게가 늘어날지 걱정입니다: -)


숙소에 대해 더 궁금한 사항이 있으시면 문의해 주세요.
