아름다운 제주바다와 사랑하는 가족이 옆에 있어 다시한번 힘을 내고 언제나 제곁에서 기적을 행하여 주신 그분 덕분에 분에 넘치는 건축을 완성하고 여러분께 인사드립니다.

제주에서 작은갤러리와 브런치카페, 게스트하우스를 운영하며 우리 가족이 잘지낼 수 있을까 걱정도 앞섰지만 웃음가득한 아이들의 환한 미소와 저만 믿고 이곳 제주 섬까지 따라와 준 아름다운 아내가 있어 걱정은 100년 후 쯤으로 던져버리려 합니다. 

