1층 객실은 2~6인의 가족 또는 친구 모임 고객님들이 이용하기 좋은 풀빌라 펜션으로 사계절 이용 가능한 단독 야외 온수풀 수영장 과 테라스 자쿠지욕조 그리고 가장 제주스러운 돌담 마당에서 바비큐와 불멍을 이용할 수 있도록 준비하였습니다.

2층 객실은 조용하게 휴식과 힐링을 원하는 커플과 신혼부부 그리고 2~4인의 private한 공간을 원하는 고객님들이 편히 쉴 수 있도록 전 객실을 복층형으로 구성하였고 120인치 대형스크린과 빔프로젝터를 설치하여 마치 소극장에서 영화를 감상하는듯한 분위기를 연출하였으며, 2층 일부 객실 테라스에는 테라스 욕조를, 그리고 다른 일부 객실에서는 테라스 바비큐를 이용하도록 하였습니다.', 19, 5, '2024-03-09 23:50:23.780', '경북대학교', '자영업', null, null, null, null, null, null, null, null, null, null),
