제주 동쪽의 대표적인 관광지인 성산일출봉, 우도, 섭지코지 등을 곁에두고 누리며, 올레 2코스에 속한 조용한 마을 오조리에 자리한 슬로우트립은 플레이모빌과 스티키몬스터 등 피규어에 빠진 주인장이 만든 개취 가득한 공간입니다.

숙소의 기본은 “깨끗함”이라는 모토 아래 청결하고, 저렴한 가격으로 만족도가 높은 곳입니다. 

게스트하우스 용도로 지어진 모던한 집은 1인실 2객실, 2인실 3객실로 이루어져 있으며 11시 소등 후에도 이용가능한 “잉여룸”이 큰 인기입니다. 

2012년에 오픈 한 슬로우트립은 호이, 호삼이란 이름의 두 강아지와 함께 산책하는 프로그램이 있어 게스트분들에게 큰 호응을 얻고 있습니다. 

