        (2179, '0ac0dd23-ef76-46dc-b82d-ddfbffa1317d', 'Rakkojae Seoul', 'https://a0.muscache.com/im/pictures/user/6c4194b7-d033-4fdf-889d-55d625c14833.jpg', 1, 1, '"한국 문화의 우아함을 경험하세요"

''과거의 전통을 즐기고 영혼을 쉴 수 있는 곳'' 이라는 뜻의 락코재 서울은 130년의 역사를 간직한 한국 전통 문화 공간입니다. 2003년 Human National Treasure-Master Carpenter Young Jin Chung에 의해 리노베이션되었으며 이후 국제적인 호평을 받았습니다. 이곳에서 한국 전통 건축물과 자연 사이에서 만들어진 조화는 한옥의 진정한 아름다움이 빛날 수 있는 기회를 만들었습니다. 우아한 정문을 지나면 깔끔하고 아늑한 한옥을 볼 수 있습니다. 정원에 흩날리는 대나무와 소나무는 자연의 아름다움을 더해주고, 각 테라스 돌에 놓인 고무신은 옛 추억의 향기를 되살려줍니다.

※ 각 객실에는 전용 욕실과 샤워/욕조가 갖춰져 있습니다.
※ 다음 게스트를 위해 객실을 제공할 수 있도록 체크인 및 체크아웃 시간을 준수해 주시기 바랍니다.', 251, 4.94, '2016-04-09 23:51:13.562', null, null, '서울, 한국', '영어, 일본어 및 한국어', null, null, null, null, null, null, null, null),
