        (2182, '0ef249ba-f7cf-42fd-9e4b-b64f943df35b', 'Letoh', 'https://a0.muscache.com/im/pictures/user/User-385021133/original/a575588f-6c69-4461-99d2-ce3a81e6590a.png', 1, 1, '오래된 집, 또는 이야기가 있는 집들을 직접 리모델링해서 스토리가 있는 숙소를 만들어 나가고 있습니다. 일 년에  한 개씩이요. 대학생 때 저는 인도와 유럽을 여행했어요. 여행지에서 중요한것은 어디를 간 것 보다, 어떤 사람을 만났느냐가 더 중요했던 것 같아요. 여행지에서 돌아오고 나서, 저도 한국에 오는 여행객들에게 좋은 환대를 주는 사람이 되고 싶었습니다. 

공간을 준비하기 위해서, 디자인을 위해 그리고 비용을 줄이기 위해서 대부분을 셀프 인테리어로 진행했습니다. 그렇기에 모든 물품들에 제 고민과 생각이 담겨있습니다. 당연하게도 항상 배딩을 교환하며, 숙소에 들어가는 비품은 최상급 또는 중급 이상의 물품들을 사용하였고, 가장 최신 기술들과 옛것들의 조화를 이루었습니다. 

